import React, { Component } from 'react'

class Home extends Component {
    constructor(props) {
        super(props);
        console.log(props)
        console.log(props.isloggedIn)
        console.log("sup")

    }
    render() {

        return (
            <div className="home">
                <div>Welcome to your Home page</div>
                <h1> Status:{this.props.loggedIn}</h1>
                <h1>User: {this.props.user}</h1>

            </div>
        );
    }
}
export default Home
